import { makeStyles, TextField } from "@material-ui/core";
import React from "react";
import { NavLink } from "react-router-dom";

const useStyles = makeStyles({
  root: {
    backgroundColor: "#ffeaa7",
    backgroundImage: "linear-gradient(315deg, #ffeaa7 0%, #000000 74%)",
    //     backgroundColor: '#5b6467',
    // backgroundImage: 'linear-gradient(315deg, #5b6467 0%, #8b939a 74%)',
    // backgroundColor: '#485461',
    // backgroundImage: 'linear-gradient(315deg, #485461 0%, #28313b 74%)',
    //    display:'flex',
    //    flexDirection:'row'
    display: "grid",
    gridTemplateColumns: "1fr 2fr",
    gridGap: "20px",
  },
  section1: {
    padding: "30px",
    display: "inline-flex",
    flexDirection: "column",
    color: "#fdc8bc",
  },
  section: {
    padding: "30px",
    display: "inline-flex",
    flexDirection: "column",
    color: "#fdc8bc",
  },
  border: {
    borderWidth: "1px",
    borderColor: "yellow !important",
  },
});
const Footer = () => {
  const classes = useStyles();
  return (
    <div className={classes.root}>
      <section className={classes.section1}>
        <a>Contact</a>
        <a>Faq</a>
        <a>Shipping & Returns</a>
        <a>Store Policy</a>
        <a>Privacy Policy</a>
        <a>Terms and Conditions</a>
        <a>Refund Policy</a>
        {/* <NavLink to="">Contact</NavLink>
        <NavLink>Faq</NavLink>
        <NavLink>Shipping & Returns</NavLink>
        <NavLink>Store Policy</NavLink>
        <NavLink>Privacy Policy</NavLink>
        <NavLink>Terms and Conditions</NavLink>
        <NavLink>Refund Policy</NavLink> */}
      </section>
      <div>
        <section className={classes.section}>
          <a>Email: clayeditbyshivani@gmail.com</a>
          {/* <NavLink>Email: clayeditbyshivani@gmail.com</NavLink> */}
        </section>
        <section className={classes.section}>
          <TextField
            className={classes.border}
            id="outlined-basic"
            label="Outlined"
            variant="outlined"
          />
        </section>
      </div>
    </div>
  );
};

export default Footer;
